import DOB from './Components/DOB.jsx';
import logo from './logo.png';
import './App.css';
import arrows from './constellationArrow.png';
import { Component } from 'react';

export default class App extends Component{




  start(){

    var landingElement = document.getElementById("landing");
    landingElement.className = "landing_hidden";
    setTimeout(function(){landingElement.parentElement.removeChild(landingElement)},4000);

    var dobElement = document.getElementById("fullDOB");

    setTimeout(function(){dobElement.className = "fullDOB";},2000);

}

  render() {
    return (
    <div className="App">
      <header className="App-header">
      <div className="stars"></div>
      <div className="twinkling"></div>
      <div className="light"></div>

      <div className="landing_shown" id="landing">
      <img src={logo} alt="Horoscope"></img>

      <img className="arrow" src={arrows} alt="Continue.." onClick={this.start}></img>


      </div>  

      <img className="logo" src={logo} alt="Horoscope"></img>

      <DOB></DOB>


      </header>
    </div>
    )
  };
}
